import React from "react";
import "./App.css";

function GetJson() {
  return [
    {
      name: "test",
      age: 32,
    },
    {
      name: "ed",
      age: 33,
    },
  ];
}

function App() {
  let data = GetJson();

  return (
    <div>
      <ul>
        {data.map((item) => {
          return <li key={item.name}>{item.name}</li>;
        })}
      </ul>
    </div>
  );
}

export default App;
